import React, { Component } from 'react';
import './Homepage.css';
// import './../img/NBA logo';

class Homepage extends Component {
    render() {
        return (
            <div>
                <h2>FUN - SPORT WEBSITE</h2>
                <div className='homepage-link'>
                    <a href="#">Sign up</a>
                    <a href="#">Log in</a>
                    <a href="#">Guest</a>
                </div>
                <div className='images'>
                    <img src='img/NBA-logo.png'></img>
                    <img src='img/C:\Users\yuval\Desktop\fun-app\FUN-Sports-Web\public\img\UFC-Logo.svg'></img>
                    <div className='football-logo'>
                        <img src='img/Seria-A.jpg'></img>
                        <img></img>
                    </div>
                </div>

            </div>
        );
    }
}

export default Homepage;
